import * as WebBrowser from 'expo-web-browser';
import React from 'react';
import { StyleSheet, TouchableOpacity, SafeAreaView, TextInput, Button } from 'react-native';

import Colors from '../constants/Colors';
import { MonoText } from './StyledText';
import { Text, View } from './Themed';

import { withAuthenticator } from 'aws-amplify-react-native';

// import { Auth } from 'aws-amplify';


import TabChat from '../screens/TabChat';

import Components_SingOut from './Components_SingOut';

function Components_Login({ path }: { path: string }) {

  const [message, onChangeMessage] = React.useState(null);

  return (
    <View>
      <Components_SingOut />
      <SafeAreaView>
        <Text>Message</Text>
        <TextInput
          style={styles.input}
          onChangeText={onChangeMessage}
          placeholder="Message"
        />
        <Button
          onPress={sendMessage}
          title="Send message"
          color="#ff9900" />
      </SafeAreaView>
    </View>
  );
}

function sendMessage() {
  console.log("Send Message")
}

function handleHelpPress() {
  WebBrowser.openBrowserAsync(
    'https://docs.expo.io/get-started/create-a-new-app/#opening-the-app-on-your-phonetablet'
  );
}

const styles = StyleSheet.create({
  getStartedContainer: {
    alignItems: 'center',
    marginHorizontal: 50,
  },
  homeScreenFilename: {
    marginVertical: 7,
  },
  codeHighlightContainer: {
    borderRadius: 3,
    paddingHorizontal: 4,
  },
  getStartedText: {
    fontSize: 17,
    lineHeight: 24,
    textAlign: 'center',
  },
  helpContainer: {
    marginTop: 15,
    marginHorizontal: 20,
    alignItems: 'center',
  },
  helpLink: {
    paddingVertical: 15,
  },
  helpLinkText: {
    textAlign: 'center',
  },
  input: {
    height: 40,
    margin: 12,
    borderWidth: 1,
    padding: 10,
  },
});


export default withAuthenticator(Components_Login);
